import todayWorkoutStyles from "../../styles/today-workout";

const days = ["Domingo", "Lunes", "Martes", "Miércoles", "Jueves", "Viernes", "Sábado"];
const months = ["Enero", "Febrero", "Marzo", "Abril", "Mayo", "Junio", "Julio", "Agosto", "Septiembre", "Octubre", "Noviembre", "Diciembre"];

const Exercises = () => <>
    <TouchableOpacity style={todayWorkoutStyles.addExcerciseButton}>
        <Entypo name="add-to-list" size={24} color="#ffffff" style={todayWorkoutStyles.addExcerciseButtonIcon}/>
        <Text style={todayWorkoutStyles.addExcerciseButtonText}>Añadir ejercicio</Text>
    </TouchableOpacity>
</>;

export default Exercises;
